import React from 'react';

function AnalysisPage() {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>صفحة تحليل الوثائق</h1>
      <p>هنا سيتم وضع واجهة إدخال المستندات وعرض النتائج القانونية.</p>
    </div>
  );
}

export default AnalysisPage;
